import React, { Fragment, useEffect } from "react";
import styled from "styled-components";
import HtmlEditor, {
  TableContextMenu,
  MediaResizing,
  Toolbar,
  Item,
} from "devextreme-react/html-editor";

const NotePadEditor = () => {
  const markup = ``; //need to be in storage criar but√£o para salvar e outro para apagar esta storage
  const sizeValues = ["8pt", "10pt", "12pt", "14pt", "18pt", "24pt", "36pt"];
  const fontValues = [
    "Arial",
    "Georgia",
    "Tahoma",
    "Times New Roman",
    "Verdana",
  ];
  const headerValues = [false, 1, 2, 3, 4, 5];

  useEffect(() => {}, []);

  const onInitialized = () => {};

  const save = () => {};

  const deleteAll = () => {};

  return (
    <Fragment>
      <HtmlEditor
        defaultValue={markup}
        onInitialized={onInitialized}
        valueType="html"
        height={660}
        width={1100}
      >
        <Toolbar multiline={true}>
          <Item name="undo" />
          <Item name="redo" />
          <Item name="separator" />
          <Item name="size" acceptedValues={sizeValues} />
          <Item name="font" acceptedValues={fontValues} />
          <Item name="separator" />
          <Item name="bold" />
          <Item name="italic" />
          <Item name="strike" />
          <Item name="underline" />
          <Item name="separator" />
          <Item name="alignLeft" />
          <Item name="alignCenter" />
          <Item name="alignRight" />
          <Item name="alignJustify" />
          <Item name="separator" />
          <Item name="orderedList" />
          <Item name="bulletList" />
          <Item name="separator" />
          <Item name="header" acceptedValues={headerValues} />
          <Item name="separator" />
          <Item name="color" />
          <Item name="background" />
          <Item name="separator" />
          <Item name="link" />
          <Item name="image" />
          <Item name="separator" />
          <Item name="clear" />
          <Item name="codeBlock" />
          <Item name="blockquote" />
          <Item name="separator" />
          <Item name="insertTable" />
          <Item name="deleteTable" />
          <Item name="insertRowAbove" />
          <Item name="insertRowBelow" />
          <Item name="deleteRow" />
          <Item name="insertColumnLeft" />
          <Item name="insertColumnRight" />
          <Item name="deleteColumn" />
          <Item name="cellProperties" />
          <Item name="tableProperties" />
        </Toolbar>
        <TableContextMenu enabled={true} />
        <MediaResizing enabled={true} />
      </HtmlEditor>
      <Button1 onClick={save}>Save</Button1>
      <Button2 onClick={deleteAll}>Delete all</Button2>
    </Fragment>
  );
};

export default NotePadEditor;

const Button1 = styled.button`
  background-color: green;
  color: white;
  border-radius: 8px;
  outline: 0;
  text-transform: uppercase;
  cursor: pointer;
  box-shadow: 0px 2px 2px lightgray;
  transition: ease background-color 250ms;
  &:hover {
    background-color: white;
    color: green;
  }
  &:disabled {
    cursor: default;
    opacity: 0.5;
  }
`;

const Button2 = styled.button`
  background-color: red;
  color: white;
  border-radius: 8px;
  outline: 0;
  text-transform: uppercase;
  cursor: pointer;
  box-shadow: 0px 2px 2px lightgray;
  transition: ease background-color 250ms;
  &:hover {
    background-color: darkred;
  }
  &:disabled {
    cursor: default;
    opacity: 0.5;
  }
`;
